import React from "react";
import CountButton from "./CountButton/CountButton.js";
import SearchBar from "./SearchBar/SearchBar.js"


const MoviesList = [
    "Taken",
    "Transporter",
    "Fast",
    "SharkTail",
    "Taxi"
]


function App() {
    return(
        <div>
            <CountButton Increase={1} StyleColor={"red"} StyleRadius={"20px"}/>
            <SearchBar MoviesList={MoviesList} />
            <CountButton Increase={5} StyleColor={"yellow"} StyleRadius={"15px"}/>
            <SearchBar MoviesList={MoviesList} />
            <CountButton Increase={10} StyleColor={"purple"} StyleRadius={"13px"}/>
        </div>
    )
}

export default App;
